(function(){var root=document.documentElement;var body=document.body;if(!root||!body){return;}body.classList.remove('cmn-no-js');body.classList.add('cmn-js');var initNav=function(){var nav=document.querySelector('.cmn-nav');var toggle=document.querySelector('.cmn-nav__toggle');var menu=document.getElementById('cmn-primary-menu');if(!nav||!toggle||!menu){return;}var closeMenu=function(){nav.classList.remove('is-open');toggle.setAttribute('aria-expanded','false');menu.setAttribute('aria-hidden','true');body.classList.remove('cmn-nav-open');};var openMenu=function(){nav.classList.add('is-open');toggle.setAttribute('aria-expanded','true');menu.setAttribute('aria-hidden','false');body.classList.add('cmn-nav-open');};toggle.addEventListener('click',function(){if(nav.classList.contains('is-open')){closeMenu();return;}openMenu();});menu.querySelectorAll('a').forEach(function(link){link.addEventListener('click',function(){if(window.matchMedia('(max-width:960px)').matches){closeMenu();}});});document.addEventListener('keydown',function(event){if(event.key==='Escape'&&nav.classList.contains('is-open')){closeMenu();toggle.focus();}});var syncMenuState=function(){if(window.matchMedia('(min-width:961px)').matches){nav.classList.remove('is-open');toggle.setAttribute('aria-expanded','false');menu.removeAttribute('aria-hidden');body.classList.remove('cmn-nav-open');return;}closeMenu();};syncMenuState();window.addEventListener('resize',function(){syncMenuState();});};var initFaqFallback=function(){var supportsDetails='open' in document.createElement('details');if(supportsDetails){return;}root.classList.add('cmn-no-details');document.querySelectorAll('.cmn-faq__item').forEach(function(item){var summary=item.querySelector('summary');if(!summary){return;}var setOpenState=function(isOpen){item.classList.toggle('is-open',isOpen);summary.setAttribute('aria-expanded',isOpen ? 'true':'false');};setOpenState(item.hasAttribute('open'));item.removeAttribute('open');summary.setAttribute('role','button');summary.setAttribute('tabindex','0');summary.addEventListener('click',function(event){event.preventDefault();setOpenState(!item.classList.contains('is-open'));});summary.addEventListener('keydown',function(event){if(event.key!=='Enter'&&event.key!==' '&&event.key!=='Spacebar'){return;}event.preventDefault();setOpenState(!item.classList.contains('is-open'));});});};initNav();initFaqFallback();})();